-- ----------------------------
-- Table structure for simcard
-- ----------------------------
DROP TABLE IF EXISTS `simcard`;
CREATE TABLE `simcard` (
  `ID` char(24) NOT NULL COMMENT '唯一编号（SIM号ID，呵呵\r\n）',
  `COMPANYID` char(24) NOT NULL COMMENT '公司唯一编号',
  `PHONENUMBER` varchar(20) NOT NULL COMMENT '电话号码',
  `SIMCARDNUMBER` varchar(20) NOT NULL COMMENT 'sim卡号',
  `SPEECHTYPE` varchar(10) DEFAULT NULL COMMENT '语音类型',
  `OPENSMS` bit(1) DEFAULT NULL COMMENT '是否开通短信',
  `CARRIEROPERATOR` varchar(20) DEFAULT NULL COMMENT '运营商',
  `PREPAYMENT` decimal(10,2) DEFAULT NULL COMMENT '预交费',
  `FLOWSET` varchar(20) DEFAULT NULL COMMENT '流量套餐',
  `CREATETIME` date DEFAULT NULL COMMENT '创建时间',
  `REMARK` varchar(50) DEFAULT NULL COMMENT '备注',
  `EDITTIME` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '时间戳',
  `OPENDATE` date DEFAULT NULL COMMENT '开通日期(SIM卡激活时间)',
  `PURCHASEDATE` date DEFAULT NULL COMMENT '购买日期',
  `EXPIREDATE` date DEFAULT NULL COMMENT '到期日期',
  `ACCOUNTNAME` varchar(66) DEFAULT NULL COMMENT 'SIM卡开户名\r\n',
  `MONTHLYRENT` varchar(66) DEFAULT NULL COMMENT 'SIM卡月租\r\n',
  `INSTOCKDATE` datetime DEFAULT NULL COMMENT 'SIM卡入库时间\r\n',
  `OUTSTOCKDATE` datetime DEFAULT NULL COMMENT 'SIM卡出库时间\r\n',
  `EXPIRENOTIFYDATE` datetime DEFAULT NULL COMMENT 'SIM卡费到期前提示时间\r\n',
  `ICCID` varchar(99) DEFAULT NULL,
  `MISDN` varchar(255) DEFAULT NULL,
  `EQUIPMENTBINDDATE` datetime DEFAULT NULL,
  `SIMSTATE` bit(1) DEFAULT NULL,
  PRIMARY KEY (`ID`) USING BTREE,
  UNIQUE KEY `SIMCARDNUMBER` (`SIMCARDNUMBER`) USING BTREE,
  UNIQUE KEY `PHONENUMBER` (`PHONENUMBER`) USING BTREE,
  KEY `COMPANYID` (`COMPANYID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='sim卡资料';

-- ----------------------------
-- Records of simcard
-- ----------------------------

