  PRIMARY KEY (`ID`) USING BTREE,
  KEY `COMPANYID` (`COMPANYID`) USING BTREE,
  KEY `USERID_USERTIME` (`USERID`,`USERTIME`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='文本信息';

